// import {REGISTER} from '../actions/types';
import {combineReducers} from 'redux';



const RegisterReducer = ([],action)=>{
    switch(action.type){
        case 'REGISTER':
            return [...[],action.payload]
            default:
                return []
    }
}
export default combineReducers({
    RegisterReducer
})
